import React from 'react'
import ReactPlayer from 'react-player'

function Stream() {

    const mySiteStream=[{name:'Gotaga',link:'https://www.twitch.tv/gotaga'},{name:'Solary',link:'https://www.twitch.tv/solary'},{name:'Skyyart',link:'https://www.twitch.tv/skyyart'}]
    return (
        <div style={{ backgroundColor: 'red', marginRight: "2%", marginTop: '1%' }}>
            Stream {mySiteStream[0].name}
            <ReactPlayer width='380px' height='300px' url='https://www.twitch.tv/gotaga' />
        </div>
    );
}

export default Stream;
